import React, { useState } from "react";
import Layout from "../components/Layout";
import styled from "styled-components";

function Post() {
	return (
		<Layout>
			<PostContainer>
				<InputContainer>
					<TitleInput value={title} onChange={onChangeTitle} />
					<InputPersonal>
						<InputName value={name} onChange={onChangeName} />
						<InputPassword value={password} onChange={onChangePassword} />
					</InputPersonal>
					<InputContent value={content} onChange={onChangeContent} />
				</InputContainer>
				<PostButtonContainer>
					<button>{"취소"}</button>
					<button>{"작성"}</button>
				</PostButtonContainer>
			</PostContainer>
		</Layout>
	);
}

export default Post;

const PostContainer = styled.div`
	display: flex;
	justify-content: space-between;
	flex-direction: column;
	width: 100%;
	height: 100%;
`;

const InputContainer = styled.div`
	display: flex;
	/* align-items: center; */
	justify-content: left;
	flex-direction: column;
	gap: 20px;
`;

const TitleInput = styled.input`
	border: none;
	border-bottom: 1px solid black;
	width: 100%;
`;

const InputPersonal = styled.div`
	display: flex;
	align-items: center;
	justify-content: flex-start;
	flex-direction: column;
	gap: 20px;
	width: 100%;
`;

const InputName = styled.input`
	margin-right: auto;
`;

const InputPassword = styled.input`
	margin-right: auto;
`;

const InputContent = styled.textarea``;

const PostButtonContainer = styled.div`
	display: flex;
	align-items: center;
	justify-content: center;
	gap: 10px;
`;
